import React from 'react'
import styled from "styled-components";

const Container = styled.div`
    background-color:var(--p-5);
    height:300px;
    width:300px;
`

const Box = styled.div`
    background-color:var(--s-5);
    height:100px;
    width:100px;
`

export default function Figure() {
    return (
        <Container>
            <Row/>
        </Container>
    )
}

const Row = () => {
    return (
        <Box/>
    )
}
